import { Pie } from "react-chartjs-2";
import AddIncome from "./AddIncome";

const IncExpChart = ({ AddIncome }) => {
  return (
    <div>
      <Pie
        data={AddIncome}
        options={{
          title: {
            display: true,
            text: "Average Rainfall per month",
            fontSize: 20,
          },
          legend: {
            display: true,
            position: "right",
          },
        }}
      />
    </div>
  );
};
export default IncExpChart;
